import React, { useEffect, useState } from 'react';
import { View, Text, StyleSheet, ScrollView, TouchableOpacity, ActivityIndicator, Image } from 'react-native';
import { getUserDetails, logoutUser } from '../services/api';
import { SafeAreaView } from 'react-native-safe-area-context';
import { Ionicons } from '@expo/vector-icons'; // Assuming Expo usage

export default function DashboardScreen({ navigation }) {
    const [user, setUser] = useState(null);
    const [loading, setLoading] = useState(true);

    const services = [
        { id: 1, title: 'Electricity', icon: 'flash', color: '#ffb300', route: 'Electricity' },
        { id: 2, title: 'Water', icon: 'water', color: '#03a9f4', route: 'Water' },
        { id: 3, title: 'Gas', icon: 'flame', color: '#ff5722', route: 'Gas' },
        { id: 4, title: 'Property', icon: 'home', color: '#4caf50', route: 'Property' },
        { id: 5, title: 'Grants', icon: 'cash', color: '#9c27b0', route: 'Grants' },
        { id: 6, title: 'Support', icon: 'help-buoy', color: '#607d8b', route: 'Support' },
    ];

    useEffect(() => {
        fetchUserData();
    }, []);

    const fetchUserData = async () => {
        try {
            const userData = await getUserDetails();
            setUser(userData);
        } catch (error) {
            console.error('Failed to fetch user data', error);
            // Optionally redirect to login if unauthorized
        } finally {
            setLoading(false);
        }
    };

    const handleLogout = async () => {
        await logoutUser();
        navigation.replace('Login');
    };

    if (loading) {
        return (
            <View style={styles.loadingContainer}>
                <ActivityIndicator size="large" color="#007bff" />
            </View>
        );
    }

    return (
        <SafeAreaView style={styles.container}>
            <ScrollView contentContainerStyle={styles.scrollContent}>
                {/* Header Section */}
                <View style={styles.header}>
                    <View>
                        <Text style={styles.greeting}>Hello,</Text>
                        <Text style={styles.username}>{user?.full_name || 'Resident'}</Text>
                    </View>
                    <TouchableOpacity onPress={handleLogout} style={styles.logoutButton}>
                        <Ionicons name="log-out-outline" size={24} color="#333" />
                    </TouchableOpacity>
                </View>

                {/* Banner Section */}
                <View style={styles.banner}>
                    <Text style={styles.bannerText}>Manage all your government services in one place.</Text>
                </View>

                {/* Services Grid */}
                <Text style={styles.sectionTitle}>Main Services</Text>
                <View style={styles.grid}>
                    {services.map((service) => (
                        <TouchableOpacity
                            key={service.id}
                            style={styles.card}
                            onPress={() => console.log(`Navigating to ${service.route}`)}
                        >
                            <View style={[styles.iconContainer, { backgroundColor: service.color + '20' }]}>
                                <Ionicons name={service.icon} size={32} color={service.color} />
                            </View>
                            <Text style={styles.cardTitle}>{service.title}</Text>
                        </TouchableOpacity>
                    ))}
                </View>
            </ScrollView>
        </SafeAreaView>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#f8f9fa',
    },
    loadingContainer: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
    scrollContent: {
        padding: 20,
    },
    header: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        marginBottom: 20,
    },
    greeting: {
        fontSize: 16,
        color: '#666',
    },
    username: {
        fontSize: 24,
        fontWeight: 'bold',
        color: '#333',
    },
    logoutButton: {
        padding: 10,
        backgroundColor: '#eee',
        borderRadius: 50,
    },
    banner: {
        backgroundColor: '#007bff',
        padding: 20,
        borderRadius: 15,
        marginBottom: 25,
        shadowColor: "#007bff",
        shadowOffset: {
            width: 0,
            height: 4,
        },
        shadowOpacity: 0.3,
        shadowRadius: 4.65,
        elevation: 8,
    },
    bannerText: {
        color: '#fff',
        fontSize: 16,
        fontWeight: '600',
        lineHeight: 24,
    },
    sectionTitle: {
        fontSize: 18,
        fontWeight: 'bold',
        marginBottom: 15,
        color: '#333',
    },
    grid: {
        flexDirection: 'row',
        flexWrap: 'wrap',
        justifyContent: 'space-between',
    },
    card: {
        width: '48%', // Adjusted for 2 columns with spacing
        backgroundColor: '#fff',
        padding: 20,
        borderRadius: 15,
        marginBottom: 15,
        alignItems: 'center',
        shadowColor: '#000',
        shadowOffset: {
            width: 0,
            height: 2,
        },
        shadowOpacity: 0.05,
        shadowRadius: 3.84,
        elevation: 2,
    },
    iconContainer: {
        padding: 15,
        borderRadius: 50,
        marginBottom: 10,
    },
    cardTitle: {
        fontSize: 14,
        fontWeight: '600',
        color: '#333',
        marginTop: 5,
    },
});
